const Table = (props) => (
    <div className="tableDiv">   
<table>
  <tr>
    <th>Transaction ID</th>
    <th>User Name</th>
    <th>Payment Mode</th>
    <th>Amount</th>

  </tr>
  <tr>
    <td>January</td>
    <td>$100</td>
    <td>$100</td>
    <td>$100</td>
  </tr>
</table>
<style jsx>{` 
table, th, td {
    border: 1px solid #7a7a7a;
    border-collapse: collapse;
    background: #ccc;
    font-weight: normal;
    font-family: sans-serif;
    font-size: 12px;
    width: 100%;
  }
   th {
    border-bottom: 2px solid #010101;
   }
  th, td {
    padding: 5px;
    text-align: center;
    width: 25%;
  }
  .tableDiv {
    background: #d9d8d9;
    margin: auto;
    width: 75%;
    padding: 21px;
    margin-top: 15px;
  }
      `}</style>
    </div>
  )
  export default Table;
